module.exports = {
  extend: function(Class, method, value) {
    if (Class.prototype.method != null) {
      return;
    }
    try {
      return Object.defineProperty(Class.prototype, method, {
        enumerable: false,
        configurable: false,
        writable: false,
        value: value
      });
    } catch (_error) {}
  }
};
